export default function HomeScreen() {
  return (
    <SafeAreaView style={styles.container}>
      <View style={styles.middle}>
        <Text>Your BlackJack Companion</Text>
      <StatusBar style="auto" />
      </View>

    </SafeAreaView>
  );
}
